import { useState } from 'react';

function HomePage() {

    const [user, setUser] = useState(false);

    if(!user){
        return <Redirect to="/login" />;
    }

    return(
        <form>
            <div className="form-inner">
                <h2>Home</h2>
            </div>
        </form>
    )
}

export default HomePage
